import XCTest
@testable import ANFVision

class ANFVisionTests: XCTestCase {

    var apiKey: String?
    
    override func setUpWithError() throws {
        // Put setup code here. This method is called before the invocation of each test method in the class.
        
        self.apiKey = ""
    }

    override func tearDownWithError() throws {
        // Put teardown code here. This method is called after the invocation of each test method in the class.
    }
    
    func testUIImageFromBase64() throws {
        
        let imageBase64String: String = ""
        
        let newImageData = Data(base64Encoded: imageBase64String)
        if let newImageData = newImageData {
            
            let img = UIImage(data: newImageData)
            XCTAssertNotNil(img)
        }
        else {
            XCTFail()
        }
    }
    
    func testImageWithoutText() throws {
        
        let imageBase64String: String = ""
        
        let newImageData = Data(base64Encoded: imageBase64String)
        if let newImageData = newImageData, let img = UIImage(data: newImageData) {

            ANFVisionManager.scanText(image: img, confidence: 0.5, onComplete: { result in
                
                switch result {
                    case .failure:
                        XCTFail()
                    case .success(let stringArr):
                        XCTAssertTrue(stringArr.count == 0, "test passed: No text found!")
                }
            })
        }
        else {
            XCTFail()
        }
    }

    func testImageWithText() throws {
        
        let imageBase64String: String = ""
        
        let newImageData = Data(base64Encoded: imageBase64String)
        if let newImageData = newImageData, let img = UIImage(data: newImageData) {

            ANFVisionManager.scanText(image: img, confidence: 0.5, onComplete: { result in
                
                switch result {
                    case .failure:
                        XCTFail()
                    case .success(let stringArr):
                        XCTAssertTrue(stringArr.count > 0, "test passed: text found!")
                }
            })
        }
        else {
            XCTFail()
        }
    }
    
    func testPhotoWithoutFace() {
        
        guard let googleAPIkey = self.apiKey else {
            XCTFail("Need API Key")
            return
        }
        
        let expectation = XCTestExpectation(description: "Test photo to check no face is available")
        var noFaceFound = true
        
        let imageBase64String: String = ""
        
        let newImageData = Data(base64Encoded: imageBase64String)
        if let newImageData = newImageData, let img = UIImage(data: newImageData) {
            
            ANFVisionManager.detectFace(image: img, apiKey: googleAPIkey, onComplete: { result in
                
                switch result {
                    
                    case .failure:
                        XCTFail()
                    
                    case .success(let response):
 
                        switch response {
                            case .noFaceDetected:()
                            default:
                                noFaceFound = false
                        }

                    expectation.fulfill()
                }
            })
        }
        else {
            XCTFail()
        }
        
        wait(for: [expectation], timeout: 30.0)
        
        XCTAssertTrue(noFaceFound, "test passed: No Face found!")
    }
    
    func testPhotoWithOneFace() {
        
        guard let googleAPIkey = self.apiKey else {
            XCTFail("Need API Key")
            return
        }
        
        let expectation = XCTestExpectation(description: "Test photo with one face")
        var oneFaceFound = true
        
        let imageBase64String: String = ""
        
        let newImageData = Data(base64Encoded: imageBase64String)
        if let newImageData = newImageData, let img = UIImage(data: newImageData) {
            
            ANFVisionManager.detectFace(image: img, apiKey: googleAPIkey, onComplete: { result in
                
                switch result {
                    
                    case .failure:
                        XCTFail()
                    
                    case .success(let response):
 
                        switch response {
                            case .ok:()
                            default:
                                oneFaceFound = false
                        }

                    expectation.fulfill()
                }
            })
        }
        else {
            XCTFail()
        }
        
        wait(for: [expectation], timeout: 30.0)
        
        XCTAssertTrue(oneFaceFound, "test passed: one Face found!")
    }
    
    func testPhotoWithMoreThanOneFace() {
        
        guard let googleAPIkey = self.apiKey else {
            XCTFail("Need API Key")
            return
        }
        
        let expectation = XCTestExpectation(description: "Test photo with more than one face")
        var moreThanOneFaceFound = true
        
        let imageBase64String: String = ""
        
        let newImageData = Data(base64Encoded: imageBase64String)
        if let newImageData = newImageData, let img = UIImage(data: newImageData) {
            
            ANFVisionManager.detectFace(image: img, apiKey: googleAPIkey, onComplete: { result in
                
                switch result {
                    
                    case .failure:
                        XCTFail()
                    
                    case .success(let response):
 
                        switch response {
                            case .moreThanOneFaceDetected:()
                            default:
                                moreThanOneFaceFound = false
                        }

                    expectation.fulfill()
                }
            })
        }
        else {
            XCTFail()
        }
        
        wait(for: [expectation], timeout: 30.0)
        
        XCTAssertTrue(moreThanOneFaceFound, "test passed: More than one Face found!")
    }
}
